    costOfLiving: 3490,
    // pv: 4300,
    // amt: 2100
  }
];

export default function App() {
  return (
    <ResponsiveContainer width="100%" height={400}>
    <LineChart
      width={500}
      height={300}
      data={data}
      margin={{
        top: 5,
        right: 30,
        left: 20,
        bottom: 5
      }}
    >
      <CartesianGrid strokeDasharray="3 3" />
      <XAxis dataKey="name" />
      <YAxis />
      <Tooltip />
      <Legend />
      {/* <Line
